import React from 'react';
import footer from './footer.module.css'

function Footer() {
  return (
    <div className={footer.glav}>
    <div className={footer.glavF}>
    <div className={footer.glav1}>d</div>
    <div className={footer.glav2}>  </div>
    <div className={footer.glav3}>  </div>
    <div className={footer.glav4}>  </div>
    </div>
    <div className={footer.glavF2}>d</div>
    </div>
  );
}

export default Footer;
